const OwnerItem = ({ profile: { user } }) => {
  return (
    <div className='profile bg-light'>
      <img src='boy.png' alt='' className='round-img' />
      <div>
        <h2>{name}</h2>
        <p>
          {email} {address && <span> at {address}</span>}{' '}
        </p>
        <p className='my-1'> {cellPhone && <span>{cellPhone}</span>} </p>
        <link to={`/profile/${_id}`} className='btn-btn-primary'>
          View Profile
        </link>
      </div>
    </div>
  );
};

OwnerItem.propTypes = {
  profile: PropTypes.object.isRequired
};

export default OwnerItem;
